import React, { Component } from 'react'
import './home.css'

export class home extends Component {
    render() {
        return (
                <div id="total">

                        <form>
                            <div class="form-group">
                                <input type="email" class="form-control" id="search" aria-describedby="emailHelp" placeholder="Search"></input>
                                <button id="btn">Search</button>
                            </div>

                        </form>

            </div>
        )
    }
}

export default home
